import React, { useState, useEffect } from 'react';
import './progressBar.css'

const ProgressBar = ({ progress }) => {
  const progressBarItems = [];

  // Assuming you want to display the progress bar 4 times
  for (let i = 0; i < 4; i++) {
    progressBarItems.push(<div key={i} className="progress-bar"></div>);
  }
  // const [progress, setProgress] = useState(0);

  //  const updateProgress = () => {
  //   if (progress < 100) {
  //     setProgress(progress + 10);
  //   }
  // };
  
  // useEffect(() => {
  //   setProgress(percentage);
  // }, [percentage]);

  return (
    <section>
      <h2>{progress}</h2>
      <div className="progress-bar-container">
      <div key={1} className="progress-bar"></div>
      <div key={2} className="progress-bar"></div>
      <div key={3} className="progress-bar"></div>
      <div key={i} className="progress-bar"></div>
      </div>
    </section>
  );
};

export default ProgressBar;
